Les Lacertiliens (Lacertilia) ou Sauriens sont un sous-ordre de reptiles diapsides de l'ordre des squamates. Leur classification fait débat car on sait aujourd'hui que ce groupe est paraphylétique. Ils font partie des squamates, aux côtés des amphisbènes (Amphisbaenia) et des serpents (Serpentes). Ce taxon regroupe environ 0 espèces de « lézards » au sens large. Bien que leurs aspects varient beaucoup d'une espèce à l'autre, il est possible de dégager quelques caractères communs à tous les représentants de l'ordre. Les Lézards ont le corps recouvert d'écailles non différenciées en grandes plaques ventrales. Ils possèdent un sternum sur lequel viennent s'appuyer des côtes. Ils sont dotés d'une ceinture scapulaire et d'une ceinture pelvienne et, en général, de 4 membres, mais chez certaines espèces, membres et ceintures ont fortement régressé ou même disparu. Les mâchoires et le crâne conservent leur mobilité, mais ce dernier tend à être plus massif que chez les Serpents. Il est difficile de décrire le Lézard type, car ces Reptiles sont très différents suivant l'espèce à laquelle ils appartiennent, mais, très sommairement, on peut les classer en 2 catégories : 
* les Lézards terrestres ou arboricoles, qui ont des pattes, un corps allongé et une queue plus ou moins développée, souvent fragile ; 
* les Lézards serpentiformes, dont les membres sont atrophiés ou même absents, et le corps cylindrique. Ceux qui vivent à la surface du sol possèdent généralement une queue longue, les autres sont semi-fouisseurs et leur queue est courte.
